import WeatherHome from "./components/WeatherHomeScreen";
import "./components/styles/style.css";
import { useEffect, useState } from "react";

export default function App() {
  const [weather, setWeather] = useState([]);

  useEffect(() => {
    fetch(
      "http://www.7timer.info/bin/astro.php?lon=113.17&lat=23.09&ac=0&lang=en&unit=metric&output=internal&tzshift=0"
    )
      .then((res) => res.json())
      .then((data) => setWeather(data));
  }, []);

  return (
    <>
      <WeatherHome weather={weather} setWeather={setWeather} />
      <main></main>
    </>
  );
}
